// Check video duration from the downloaded file
const videoBuffer = items[0].binary.data.data;
const fileSizeBytes = videoBuffer.length;
const fileSizeMB = fileSizeBytes / (1024 * 1024);

// Rough estimation: assume ~1MB per 10 seconds for typical social media videos
// Adjust this ratio based on your video quality/bitrate
const estimatedDuration = (fileSizeMB * 10); // seconds

// Try to parse basic MP4 metadata for more accurate duration
let actualDuration = null;
try {
  const buffer = Buffer.from(videoBuffer);
  // Look for 'mvhd' atom which contains duration info
  const mvhdIndex = buffer.indexOf('mvhd');
  if (mvhdIndex !== -1 && mvhdIndex + 20 < buffer.length) {
    // Read timescale and duration from mvhd atom
    const timeScale = buffer.readUInt32BE(mvhdIndex + 12);
    const duration = buffer.readUInt32BE(mvhdIndex + 16);
    if (timeScale > 0) {
      actualDuration = duration / timeScale;
    }
  }
} catch (error) {
  console.log('Could not parse MP4 metadata:', error.message);
}

const finalDuration = actualDuration || estimatedDuration;

return [{
  json: {
    file_size_mb: Math.round(fileSizeMB * 100) / 100,
    estimated_duration: estimatedDuration,
    parsed_duration: actualDuration,
    final_duration: finalDuration,
    duration_seconds: Math.round(finalDuration),
    is_reel_eligible: finalDuration <= 90,
    post_type: finalDuration <= 90 ? 'reel' : 'video'
  },
  binary: items[0].binary // Pass through the video file
}];
